import React from 'react';
import { Link } from 'react-router-dom';

const Cards = ({ detail }) => {
  console.log('Received detail:', detail); // Debugging line

  return (
    <div className='meals'>
      {
        !detail || detail.length === 0 ? "Sorry Data Not Found" : detail.map((curItem) => {
          console.log('Rendering item:', curItem); // Debugging line
          return (
            <div className='mealImg' key={curItem.dishId}>
              <img src={curItem.image} alt={curItem.title} />
              <p>{curItem.title}</p>
              <Link to={`/state/${curItem.dishId}/dishes/${curItem.dishId}`}>
                <button>Recipe</button>
              </Link>
            </div>
          );
        })
      }
    </div>
  );
}

export default Cards;
